  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116136 includes chemical,
  discrete sample, physical and profile data collected from ROGER REVELLE in the South
  Pacific Ocean from 1997-12-02 to 1998-01-03 and retrieved during cruise AESOPS RR_KIWI-7
  and Ross_Sea_33RR19971202. These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PARTICULATE ORGANIC
  CARBON, PARTICULATE ORGANIC NITROGEN, PHOSPHATE, Potential temperature (theta),
  SALINITY, SILICATE, Total Organic Carbon (TOC), WATER TEMPERATURE and pH. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  R Barber of Duke University and Frank J. Millero of Rosenstiel School of Marine
  and Atmospheric Science as part of the CLIVAR_Ross_Sea_33RR19971202 data set.nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
